    "Could not check that your web server serves security headers correctly, unable to query `%s`" : "Níorbh fhéidir a sheiceáil go bhfreastalaíonn do fhreastalaí Gréasáin ceanntásca slándála i gceart, ní féidir `%s` a cheistiú",
    "Your server is correctly configured to send security headers." : "Tá do fhreastalaí cumraithe i gceart chun ceanntásca slándála a sheoladh.",
    "Database version" : "Leagan bunachar sonraí",
    "MariaDB version 10.3 detected, this version is end-of-life and only supported as part of Ubuntu 20.04. MariaDB >=%1$s and <=%2$s is suggested for best performance, stability and functionality with this version of Nextcloud." : "Braitheadh ​​MariaDB leagan 10.3, tá an leagan seo ag deireadh ré agus ní thacaítear leis ach mar chuid de Ubuntu 20.04. MariaDB >= Moltar %1$s agus <=%2$s don fheidhmíocht, don chobhsaíocht agus don fheidhmiúlacht is fearr leis an leagan seo de Nextcloud.",
    "MariaDB version \"%1$s\" detected. MariaDB >=%2$s and <=%3$s is suggested for best performance, stability and functionality with this version of Nextcloud." : "Braitheadh ​​leagan MariaDB \"%1$s\". MariaDB >= Moltar %2$s agus <=%3$s don fheidhmíocht is fearr, don chobhsaíocht agus don fheidhmiúlacht leis an leagan seo de Nextcloud.",
    "MySQL version \"%1$s\" detected. MySQL >=%2$s and <=%3$s is suggested for best performance, stability and functionality with this version of Nextcloud." : "Braitheadh ​​leagan MySQL \"%1$s\". MySQL >= Moltar %2$s agus <=%3$s don fheidhmíocht, don chobhsaíocht agus don fheidhmiúlacht is fearr leis an leagan seo de Nextcloud.",
    "PostgreSQL version \"%1$s\" detected. PostgreSQL >=%2$s and <=%3$s is suggested for best performance, stability and functionality with this version of Nextcloud." : "Braitheadh ​​leagan PostgreSQL \"%1$s\". PostgreSQL >= Moltar %2$s agus <=%3$s don fheidhmíocht, don chobhsaíocht agus don fheidhmiúlacht is fearr leis an leagan seo de Nextcloud.",
    "SQLite is currently being used as the backend database. For larger installations we recommend that you switch to a different database backend. This is particularly recommended when using the desktop client for file synchronisation. To migrate to another database use the command line tool: \"occ db:convert-type\"." : "Tá SQLite in úsáid faoi láthair mar bhunachar sonraí backend. Le haghaidh suiteálacha níos mó molaimid duit aistriú chuig inneall bunachar sonraí eile. Moltar é seo go háirithe agus an cliant deisce á úsáid chun comhaid a shioncronú. Chun aistriú go dtí bunachar sonraí eile bain úsáid as an uirlis ordaithe: \"occ db:convert-type\".",
    "Unknown database platform" : "Clár bunachar sonraí anaithnid",
    "Architecture" : "Ailtireacht",
    "64-bit" : "64-giotán",
    "It seems like you are running a 32-bit PHP version. Nextcloud needs 64-bit to run well. Please upgrade your OS and PHP to 64-bit!" : "Is cosúil go bhfuil leagan PHP 32-giotán á rith agat. Tá 64-giotán ag teastáil ó Nextcloud chun go n-éireoidh go maith. Uasghrádaigh do OS agus PHP go 64-giotán le do thoil!",
    "Temporary space available" : "Spás sealadach ar fáil",
    "Error while checking the temporary PHP path - it was not properly set to a directory. Returned value: %s" : "Earráid agus an cosán PHP sealadach á sheiceáil - níor socraíodh go heolaire é i gceart. Luach aischurtha: %s",
    "The PHP function \"disk_free_space\" is disabled, which prevents the check for enough space in the temporary directories." : "Tá an fheidhm PHP \"disk_free_space\" díchumasaithe, rud a chuireann cosc ​​​​ar an seiceáil le haghaidh spás leordhóthanach sna heolairí sealadacha.",
    "Error while checking the available disk space of temporary PHP path or no free disk space returned. Temporary path: %s" : "Earráid agus an spás diosca atá ar fáil de chonair PHP sealadach á sheiceáil nó níor cuireadh aon spás diosca saor in aisce ar ais. Conair shealadach: %s",
    "- %.1f GiB available in %s (PHP temporary directory)" : "- %.1f GiB ar fáil i %s (eolaire sealadach PHP)",
    "- %.1f GiB available in %s (Nextcloud temporary directory)" : "- %.1f GiB ar fáil i %s (eolaire sealadach Nextcloud)",
    "Temporary directory is correctly configured:\n%s" : "Tá an eolaire sealadach cumraithe i gceart:\n%s",
    "This instance uses an S3 based object store as primary storage, and has enough space in the temporary directory.\n%s" : "Úsáideann an cás seo stór réad bunaithe ar S3 mar phríomhstóráil, agus tá go leor spáis san eolaire sealadach.\n%s",
    "This instance uses an S3 based object store as primary storage. The uploaded files are stored temporarily on the server and thus it is recommended to have 50 GiB of free space available in the temp directory of PHP. To improve this please change the temporary directory in the php.ini or make more space available in that path. \nChecking the available space in the temporary path resulted in %.1f GiB instead of the recommended 50 GiB. Path: %s" : "Úsáideann an cás seo stór réad bunaithe ar S3 mar phríomhstóráil. Stóráiltear na comhaid uaslódáilte go sealadach ar an bhfreastalaí agus mar sin moltar 50 GiB de spás saor in aisce a bheith ar fáil in eolaire teocht PHP. Chun é seo a fheabhsú, athraigh an t-eolaire sealadach sa php.ini nó cuir níos mó spáis ar fáil sa chonair sin le do thoil. \nMar thoradh ar sheiceáil an spáis a bhí ar fáil sa chosán sealadach bhí %.1f GiB in ionad an 50 GiB atá molta. Conair:\n%s",
    "Database transaction isolation level" : "Leibhéal leithlisithe idirbheart bunachar sonraí",
    "Your database does not run with \"READ COMMITTED\" transaction isolation level. This can cause problems when multiple actions are executed in parallel." : "Ní ritheann do bhunachar sonraí le leibhéal leithlisithe idirbheart \"READ COMMITTED\". Féadann sé seo fadhbanna a chruthú nuair a dhéantar ilghníomhartha i gcomhthráth.",
    "Was not able to get transaction isolation level: %s" : "Níorbh fhéidir an leibhéal leithlisithe idirbhirt a fháil:\n%s",
    ".well-known URLs" : "URLanna .maith ar a dtugtar",
    "`check_for_working_wellknown_setup` is set to false in your configuration, so this check was skipped." : "Tá `check_for_working_wellknown_setup` socraithe go bréagach i do chumraíocht, mar sin níor bacadh leis an tseiceáil seo.",
    "Could not check that your web server serves `.well-known` correctly. Please check manually." : "Níorbh fhéidir a sheiceáil go bhfreastalaíonn do fhreastalaí gréasáin `.well-known` i gceart. Seiceáil le do thoil de láimh.",
    "Your web server is not properly set up to resolve `.well-known` URLs, failed on:\n`%s`" : "Níl do fhreastalaí gréasáin socraithe i gceart chun URLanna `.well-known` a réiteach, ar theip ar:\n`%s`",
    "Your server is correctly configured to serve `.well-known` URLs." : "Tá do fhreastalaí cumraithe i gceart chun URLanna `.well-known` a sheirbheáil.",
    "Font file loading" : "Comhad cló á luchtú",
    "Could not check for {extension} loading support. Please check manually if your webserver serves `.{extension}` files." : "Níorbh fhéidir tacaíocht lódála {extension} a sheiceáil. Seiceáil le do thoil de láimh an bhfreastalaíonn do fhreastalaí gréasáin ar chomhaid `.{extension}`.",
    "Your web server is not properly set up to deliver .{extension} files. This is typically an issue with the Nginx configuration. For Nextcloud 15 it needs an adjustment to also deliver .{extension} files. Compare your Nginx configuration to the recommended configuration in our documentation." : "Níl do fhreastalaí gréasáin socraithe i gceart chun comhaid .{extension} a sheachadadh. De ghnáth is saincheist é seo le cumraíocht Nginx. I gcás Nextcloud 15 tá gá le coigeartú chun comhaid .{extension} a sheachadadh freisin. Déan do chumraíocht Nginx a chur i gcomparáid leis an gcumraíocht mholta inár gcáipéisíocht.",
