    "Please read carefully before activating server-side encryption:" : "Léigh go cúramach le do thoil sula ngníomhachtaítear criptiúchán ar thaobh an fhreastalaí:",
    "Once encryption is enabled, all files uploaded to the server from that point forward will be encrypted at rest on the server. It will only be possible to disable encryption at a later date if the active encryption module supports that function, and all pre-conditions (e.g. setting a recover key) are met." : "Nuair a bheidh an criptiú cumasaithe, beidh gach comhad a uaslódáiltear chuig an bhfreastalaí ón bpointe sin ar aghaidh criptithe ar fos ar an bhfreastalaí. Ní bheidh sé indéanta criptiú a dhíchumasú níos déanaí má thacaíonn an modúl gníomhach criptithe leis an bhfeidhm sin, agus má chomhlíontar na réamhchoinníollacha go léir (m.sh. eochair athshlánaithe a shocrú).",
    "Encryption alone does not guarantee security of the system. Please see documentation for more information about how the encryption app works, and the supported use cases." : "Ní ráthaíonn criptiú amháin slándáil an chórais. Féach ar an gcáipéisíocht le haghaidh tuilleadh faisnéise faoin gcaoi a n-oibríonn an aip criptithe le do thoil, agus na cásanna úsáide tacaithe.",
